static const char * jamo_t[] = {
    "", "G", "GG", "GS", "N", "NJ", "NH", "D", "L", "LG", "LM", "LB", "LS",
    "LT", "LP", "LH", "M", "B", "BS", "S", "SS", "NG", "J", "C", "K", "T",
    "P", "H",
};

static char* get_derived_name(unichar_t ch) {
    if (ch >= 0xAC00 && ch <= 0xD7A3) {
        ch -= 0xAC00;
        int l = ch / JAMO_N_COUNT;
        int v = (ch % JAMO_N_COUNT) / JAMO_T_COUNT;
        int t = ch % JAMO_T_COUNT;
        return smprintf("HANGUL SYLLABLE %s%s%s",
            jamo_l[l], jamo_v[v], jamo_t[t]);
    }
    if ((ch >= 0x3400 && ch <= 0x4DBF) || (ch >= 0x4E00 && ch <= 0x9FFC) ||
        (ch >= 0x20000 && ch <= 0x2A6DD) || (ch >= 0x2A700 && ch <= 0x2B734) ||
        (ch >= 0x2B740 && ch <= 0x2B81D) || (ch >= 0x2B820 && ch <= 0x2CEA1) ||
        (ch >= 0x2CEB0 && ch <= 0x2EBE0) || (ch >= 0x30000 && ch <= 0x3134A)) {
        return smprintf("CJK UNIFIED IDEOGRAPH-%X", ch);
    }
    if ((ch >= 0xF900 && ch <= 0xFA6D) || (ch >= 0xFA70 && ch <= 0xFAD9) ||
        (ch >= 0x2F800 && ch <= 0x2FA1D)) {
        return smprintf("CJK COMPATIBILITY IDEOGRAPH-%X", ch);
    }
    if ((ch >= 0x17000 && ch <= 0x187F7) || (ch >= 0x18D00 && ch <= 0x18D08)) {
        return smprintf("TANGUT IDEOGRAPH-%X", ch);
    }
    if (ch >= 0x18B00 && ch <= 0x18CD5) {
        return smprintf("KHITAN SMALL SCRIPT CHARACTER-%X", ch);
    }
    if (ch >= 0x1B170 && ch <= 0x1B2FB) {
        return smprintf("NUSHU CHARACTER-%X", ch);
    }
    return NULL;
}

